define({"topics" : [{"title":"Publish Pipelines Directly","shortdesc":"\n               <p class=\"shortdesc\">When <span class=\"ph\">SDC Edge</span> is         running and is accessible by the <span class=\"ph\">Data Collector</span>         machine, you can use the publish method to deploy edge pipelines to <span class=\"ph\">SDC Edge</span>. You         can publish a single pipeline or multiple pipelines at one time.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Deploy.html#concept_jxj_pd5_32b","attributes": {"data-id":"concept_jxj_pd5_32b",},"menu": {"hasChildren":true,},"tocID":"concept_jxj_pd5_32b-d46e187629","next":"concept_jxj_pd5_32b-d46e187629",},{"title":"Export Pipelines","shortdesc":"\n               <p class=\"shortdesc\">If <span class=\"ph\">SDC Edge</span> is not         running or if it is not accessible by the <span class=\"ph\">Data Collector</span>         machine, you must use the export method to deploy edge pipelines to <span class=\"ph\">SDC Edge</span>.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Deploy.html#task_rzb_zgm_pbb","attributes": {"data-id":"task_rzb_zgm_pbb",},"menu": {"hasChildren":false,},"tocID":"task_rzb_zgm_pbb-d46e187737","topics":[]}]});